(657, 895, 'cmt', 'Hei Camilla.\r\n\r\nN har pappa gtt litt nyere igjennom plantegningene.\r\n\r\nDet er en del mangler. Noen som vi mener er viktig og sikkert mindre viktige detaljer.\r\n\r\n10 punkter er markert p bilder under.\r\n\r\n \r\n\r\n1.      Sett inn skyvedr\r\n\r\n2.      Sett inn vindu\r\n\r\n3.      Gjr rommet strre ihht rde streker\r\n\r\n4.      Lag rommet ihht rde streker\r\n\r\n5.      Sett inn dr\r\n\r\n6.      Sett inn vindu\r\n\r\n7.      Sett inn dr\r\n\r\n8.      Fjern dr\r\n\r\n9.      Sett inn dr\r\n\r\n10.   Fjern dr\r\n\r\n\r\nHei Camilla.\r\n\r\nHar n gtt igjennom salgsoppgaven.\r\n\r\nNoen punkter:\r\n\r\n1.      Bytte ut BSR med oppdatert versjon.\r\n\r\n2.      Skrive p hvilken etasje de forskjellige plantegningene har.\r\n\r\n3.      Plantegning av loftsetasje er feil. Se vedlagt bilde.\r\n\r\n4.      Ser at det er krysset av p nei nr det gjelder sprekk i fliser i egenerklringen. Dette er derimot ettertrykkelig nevnt i BSR, tror du det er ndvendig  endre egenerklringen.', '9', '2016/09/', 'CM-ID895-21147446237833.jpg,CM-ID895-21147446237832.jpg,CM-ID895-21147446237855.jpg', '2016-09-21 12:52:58'),
